(18, 'Share to', '', '<!-- AddThis Smart Layers BEGIN -->\r\n<!-- Go to http://www.addthis.com/get/smart-layers to customize -->\r\n<script type="text/javascript" src="//s7.addthis.com/js/300/addthis_widget.js#pubid=ra-52df7bf154401ce8"></script>\r\n<script type="text/javascript">\r\n  addthis.layers({\r\n    ''theme'' : ''transparent'',\r\n    ''share'' : {\r\n      ''position'' : ''left'',\r\n      ''numPreferredServices'' : 7\r\n    },  \r\n    ''whatsnext'' : {}  \r\n  });\r\n</script>\r\n<!-- AddThis Smart Layers END -->', 'script', 16, 0, '', 0, '1', '', 0, 0),
(10, 'Tvoja poloha', '', '		<p id="demo">Kde sa prave nachadzas:</p>\r\n		<button onclick="getLocation()">Zisti si to teraz</button>\r\n		<div id="mapholder"></div>\r\n		<script src="http://maps.google.com/maps/api/js?sensor=false"></script>\r\n		<script>\r\n			var x=document.getElementById("demo");\r\n			function getLocation()\r\n			  {\r\n			  if (navigator.geolocation)\r\n			    {\r\n			    navigator.geolocation.getCurrentPosition(showPosition,showError);\r\n			    }\r\n			  else{x.innerHTML="Geolocation is not supported by this browser.";}\r\n			  }\r\n\r\n			function showPosition(position)\r\n			  {\r\n			  lat=position.coords.latitude;\r\n			  lon=position.coords.longitude;\r\n			  latlon=new google.maps.LatLng(lat, lon)\r\n			  mapholder=document.getElementById(''mapholder'')\r\n			  mapholder.style.height=''250px'';\r\n			  mapholder.style.width=''300px'';\r\n\r\n			  var myOptions={\r\n			  center:latlon,zoom:14,\r\n			  mapTypeId:google.maps.MapTypeId.ROADMAP,\r\n			  mapTypeControl:false,\r\n			  navigationControlOptions:{style:google.maps.NavigationControlStyle.SMALL}\r\n			  };\r\n			  var map=new google.maps.Map(document.getElementById("mapholder"),myOptions);\r\n			  var marker=new google.maps.Marker({position:latlon,map:map,title:"You are here!"});\r\n			  }\r\n\r\n			function showError(error)\r\n			  {\r\n			  switch(error.code) \r\n			    {\r\n			    case error.PERMISSION_DENIED:\r\n			      x.innerHTML="User denied the request for Geolocation."\r\n			      break;\r\n			    case error.POSITION_UNAVAILABLE:\r\n			      x.innerHTML="Location information is unavailable."\r\n			      break;\r\n			    case error.TIMEOUT:\r\n			      x.innerHTML="The request to get user location timed out."\r\n			      break;\r\n			    case error.UNKNOWN_ERROR:\r\n			      x.innerHTML="An unknown error occurred."\r\n			      break;\r\n			    }\r\n			  }\r\n		</script>', 'script', 12, 0, '0', 0, '1', '', 0, 0),
